import React from 'react'

const VideoBox = (props) => {
    console.log(props.name);
  return (
   <div className="grid-item"> 
        <video
            src
            poster={props.poster}
            className="home-video"
        ></video>
        
        <span style={{color: 'black'}}>{props.name}</span>
    </div>
  )
}

export default VideoBox
